import React, { useState } from 'react';
import './App.css';
import AuthPage from './Authentication/auth_page';
import ExpenseTracker from './expense/expense_tracker';

const App = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [username, setUsername] = useState('');

  const handleLogin = (username) => {
    setIsLoggedIn(true);
    setUsername(username);
  };

  const handleLogout = () => {
    setIsLoggedIn(false);
    setUsername('');
  };

  return (
    <div className="app">
      {!isLoggedIn ? (
        <AuthPage onLogin={handleLogin} />
      ) : (
        <ExpenseTracker username={username} onLogout={handleLogout} />
      )}
    </div>
  );
};

export default App;
